CREATE FUNCTION public.calculate_total(p_surgery_id character varying, p_surgery_date date) RETURNS money
    LANGUAGE plpgsql
    AS $$
DECLARE
    surgery_price MONEY;
    calculated_total MONEY;
BEGIN
    -- Lấy giá trị Price từ bảng surgery
