-- TOC entry 257 (class 1255 OID 37144)
-- Name: upgrade_department(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.upgrade_department(from_year integer, to_year integer) RETURNS TABLE(department_name character varying, quantity integer)
    LANGUAGE plpgsql
    AS $$
DECLARE 
total INTEGER;
cnt_test INTEGER := 0;
cnt_surgery INTEGER := 0;
k RECORD;
fromdate DATE;
todate DATE;
BEGIN
fromdate := to_date(from_year::text, 'YYYY');
todate := to_date(to_year::text, 'YYYY');

FOR k IN
SELECT 
d.department_id, 
d.department_name
FROM 
department d
LOOP
SELECT 
COUNT(*) INTO cnt_test
        		FROM 
test t
        		JOIN 
test_line tl ON t.test_id = tl.test_id
        		WHERE 
t.department_id = k.department_id
        			AND 
tl.date BETWEEN fromdate AND todate;
        		SELECT 
COUNT(*) INTO cnt_surgery
        			FROM 
surgery s
JOIN 
surgery_line sl ON s.surgery_id = sl.surgery_id
WHERE 
s.department_id = k.department_id
AND 
sl.date BETWEEN fromdate AND todate;
        			total := cnt_test + cnt_surgery;
        	IF total > 0 THEN
            	department_name := k.department_name;
            	quantity := total;
RETURN NEXT;
END IF;
    	END LOOP;
END;
$$;


ALTER FUNCTION public.upgrade_department(from_year integer, to_year integer) OWNER TO postgres;

